import { NavLink } from "react-bootstrap";
const Index = (props) => {
  const Link = () => {
    <>
      <NavLink
        to={props.TitleLink ? props.TitleLink : <span>fkbvfb</span>}
        className="profil_emp_inter_page_title finance_inter_page_title"
      >
        {props.TilelIcon}
        {props.Name}
      </NavLink>
    </>;
  };
  return <>{navItems ? <DropdownItem /> : <NavItem />}</>;
};
export default Index;
